    <body>
        <div> Date bese</div>
        <Link href="/">Home page </Link>
        <h1>{potsData.id}</h1>
    </body>
)

export async function getStaticProps(){
    const potsData=getPostData()
    return{
        props:{
            potsData
        }
    
    }
}

export default data
